import {useState} from 'react';
import Backdrop from './Component2/Backdrop';

function Settings(props){
  return (
    <div>
      <div className='card'>
        Settings
      </div>
      <div className='card'>
      <div className='actions'>
        <button className='btn'>Delete Account</button>
      </div>
      </div>
    </div>
  )
}
export default Settings;
